//   style: {
//     filter: "blur(50px)"
//   },
//   detectRetina: true,
// }










class App extends Component {
  render() {
    return (
      <div className="App">
        <Particles className='particles'
          params = {particleOptions} 
        />
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm />
                   {/* <FaceRecognition /> */}
      </div>
    );
  } 
}

export default App;
